INSERT INTO public."Predicts_comments" (id, prediction_id, comment, created_date, updated_date, message_id, message_url) VALUES (1, 111, 'Всем, привет! Сегодня смотрим как закроется и будет видно, что делать. У кого большое депо можно усреднить немного сейчас 43-44, а так уровень для усреднения в районе 39. Когда усреднять на 39 я еще напишу. Прошу простить за нервный прогноз.', '2021-12-21 18:25:49.362786', NULL, 472, 'https://t.me/c/1708553007/472');
INSERT INTO public."Predicts_comments" (id, prediction_id, comment, created_date, updated_date, message_id, message_url) VALUES (2, 123, 'Zynex, Inc. объявила о выплате специального дивиденда в форме денежных средств, а также в виде акций ZYXI. 

Ожидается, что выплата дивиденда состоится 21 января 2022 года. Согласно объявленной информации сумма денежных дивидендов составит по 0,10 USD на одну акцию, а размер выплаты в виде ценных бумаг – 10 % от имеющегося количества акций ZYXI.', '2021-12-23 07:50:12.971131', NULL, 494, 'https://t.me/c/1708553007/494');
INSERT INTO public."Predicts_comments" (id, prediction_id, comment, created_date, updated_date, message_id, message_url) VALUES (3, 119, 'Для рисковых - можно усреднить, если опять пойдёт ниже без отскока => я склоняюсь к отмене.', '2021-12-23 14:44:53.404818', NULL, 503, 'https://t.me/c/1708553007/503');
INSERT INTO public."Predicts_comments" (id, prediction_id, comment, created_date, updated_date, message_id, message_url) VALUES (4, 125, 'Так, что мы имеем на данный момент (22:30 мск)
1) жадность победила страх, что в данный момент было неверным решением (согласен, после похода на 1000 надо было выходить по 1005-1007)
2) что происходит сейчас
На мой взгляд, вынос шортистов, возможно при движении на 997 был вынос лонгистов, но я думаю лонгистов вынесут гораздо ниже. Мы не закрыли гэп на 940-960 и сейчас идём вверх, но рост утихает и я думаю выше 1100 мы не прыгнем.

-> продолжение в комментариях', '2021-12-23 19:27:11.943413', NULL, 509, 'https://t.me/c/1708553007/509');
INSERT INTO public."Predicts_comments" (id, prediction_id, comment, created_date, updated_date, message_id, message_url) VALUES (5, 113, '$YNDX, $OZON, $VKCO, $SGZH сегодня будут сбивать стопы практически по всем рос акциям, + будет много кто станет шортить. Пример - по Яндексу многие ставили стопы на 4350-4352, их вынесли, по вк, озону аналогично, Белуга вообще должна сегодня/край на следующей неделе взорваться вверх', '2021-12-24 09:19:08.485409', NULL, 510, 'https://t.me/c/1708553007/510');
INSERT INTO public."Predicts_comments" (id, prediction_id, comment, created_date, updated_date, message_id, message_url) VALUES (6, 126, 'И сразу скажу почему тейк выставил такой.,а не выше т.к. откроется гэпом и т.п.. Моя задача, чтобы вы получили профит. Данная акция много раз билась в 23 и падала вниз.  Поэтому лучше синица в руках. И по поводу VIR, я не отменяю прогноз т.к. процентов 90 что будут позитивные новости в течение 2-х недель. Бежать усреднять пока не стоит.', '2021-12-27 00:31:42.888264', NULL, 553, 'https://t.me/c/1708553007/553');
INSERT INTO public."Predicts_comments" (id, prediction_id, comment, created_date, updated_date, message_id, message_url) VALUES (7, 125, 'В продолжение к предыдущему комментарию: для рисковых - можете усреднять шорт в диапазоне 1085-1095, но тут уже на ваш риск, могут ещё запампить, но как и писал ранее - не должны выше 1100 пойти, край - 1110.5', '2021-12-27 14:57:39.099893', NULL, 560, 'https://t.me/c/1708553007/560');
INSERT INTO public."Predicts_comments" (id, prediction_id, comment, created_date, updated_date, message_id, message_url) VALUES (8, 111, 'Можно усреднить , только не на все депо. Так же на 5 процентов. В течение 1-2-х недель будут результаты 1 фазы вакцины по ВИЧ.', '2021-12-28 18:10:19.462558', NULL, 569, 'https://t.me/c/1708553007/569');
INSERT INTO public."Predicts_comments" (id, prediction_id, comment, created_date, updated_date, message_id, message_url) VALUES (9, 111, 'Компания проводит испытание фазы 1 проверки концепции VIR-1111, исследовательской вакцины против Т-клеток ВИЧ на основе цитомегаловируса человека (HCMV), чтобы оценить, может ли этот новый подход вызвать потенциально защитные иммунные реакции, которые отличаются от других вакцин против ВИЧ. Первоначальные клинические данные первой когорты ожидаются в четвертом квартале 2021 года. Данная информация с официального сайта компании.', '2021-12-28 19:09:23.851093', NULL, 574, 'https://t.me/c/1708553007/574');
INSERT INTO public."Predicts_comments" (id, prediction_id, comment, created_date, updated_date, message_id, message_url) VALUES (10, 132, 'Доброе утро друзья👋на текущем рынке, прошу использовать стопы на -3%.', '2021-12-29 05:28:45.196312', NULL, 577, 'https://t.me/c/1708553007/577');
