INSERT INTO public."Predicts_comments" (id, prediction_id, comment, created_date, updated_date, message_id, message_url) VALUES (66, 145, 'Большой пост по всем моим прогнозам. Всем, кто им следует, просьба дочитать.
1) $NVAX $MRNA Всё слишком нелогично, хотя это становится привычным. В нынешних условиях компании должны расти кратно, но как минимум ФРС мешает этому. Готовые к среднесроку - оставляйте\ усредняйте по мере падения. Компании не мусорные, это главное. Краткосрочникам, видимо, лучше зарезать лося. Тем не менее,буду по ним ещё давать прогнозы

2) $TCSG Все мои прогнозы по рос. рынку, данные позже 10 января, сбылись, кроме этого. И принципиально не хочу отменять его. В отношениях с западом ещё множество может быть передряг, но TCS - компания, которая реально делает. Этот банк ещё сделает иксы, пусть и в долгосроке. Лишь бы войны не было

3) $LI  Отличная компания, вполне может сходить к цели. Стопы в районе 28 можно расставить, но думаю, в 0 вы всегда сможете выйти. Второй день подряд цена порывается ближе к 32$, но пока безуспешно

4) $CORR в плюс сможете скинуть, только ждите, но меньше 4.25 не продавайте

5) $RIG Та же нелогичная хрень. Новый договор, растущая нефть, а она падает. Лучше подождать.

6) $ZGNX Подходим к вишенке. Первый прогноз хоть и успешный, но нынешняя ситуация повергает в шок. Первый раз вижу, чтобы торговая цена была так близко к цене выкупа, который предполагается, хотя ни одного одобрения ещё нет. Потерпите и хоть не в плюс, но выйти с меньшим убытком можно будет

P.S. За последние дни дал много плюсовых прогнозов, но каждый прогноз наподобие #ZGNX и $TCSG обнуляет прошлые 2.5, а то и 3 плюсовых прогноза. Такая ситуация не нравится мне, и уж тем более вам. Поэтому, прошу прощения у вас. К сожалению, слишком непредсказуемо и нелогично ведёт себя рынок. Поэтому, пока не буду давать прогнозы, или буду, но реже, только на реальных драйверах. Надеюсь, все выйдут в итоге в хороший плюс.', '2022-01-19 21:43:22.404466', NULL, 966, 'https://t.me/c/1708553007/966');
