INSERT INTO public."Predicts_comments" (id, prediction_id, comment, created_date, updated_date, message_id, message_url) VALUES (99, 264, 'Пост по всем моим прогнозам. Для начала внесу ясность.
Я внимательно следил за новостями от ФРС и публиковал прогнозы\отменял исходя из того, что слышу, а не смотря на свечи. 
В пульсе я уже недавно писал, что мои ожидания такие: отрицательные заявления - падаем, нейтральные - недолго растём, потом падаем, положительных заявлений не ждал.
Результаты заседания ФРС - нейтральные, поэтому, посчитал, что будет недолгий рост, дал прогнозы по $AMD и $NVAX. Вот только на пресс-конференции Пауэлл сказал, что допускает повышение ставок на каждом заседании, деньги вкладывать они не собираются, к началу марта вообще закрутят гайки. Я мог бы не отменять прогнозы, но, как по мне, это плохо отразилось бы на балансах тех, кто следует моим прогнозам. Думаю, это не нужно ни мне, ни вам. И в целом теперь я ожидаю медвежьих настроений в США.
Теперь по моим прогнозам:
1) $SPCE Как говорил до этого, пожадничал, 0.5% из 6,5% до цели не дошел, но всё равно жду медленного падания
2) $AMD Почему переобулся в шорт, уже написал. Тем более, техи очень восприимчивы к подобным новостям
3) $NFLX Падение на отчёте отыграно, но жду дальнейшего спада
4) $NVAX Компания супер, ожидаются одобрения, но экономическая ситуация не позволяет расти. Для тех, у кого нет шорта, считайте рекомендацией продать купленное.
5) $SBER И экономическая ситуация сложная, и политика не радует. НАТО и США особо отступать не хотят. На чём расти-то? Шорт
6) $LI Здесь ситуация довольно тонкая. С одной стороны, у компании дела идут неплохо, Китай экономику поддерживает, плохих новостей от правительства нет, но торгуется-то бумага в США. Идёт вниз за рынком. Возможно, пора резать
7) $TCSG напоследок мой любимчик. Ситуация та же, целесообразно - резать, если рассматривать краткосрок. Если смотреть, скажем, на год вперёд и ситуация с Украиной разрешится, то оптимизма по бумаге у меня много
8) По отменённым мной прогнозам, помимо AMD и новавакса: $RIG $CORR $MRNA Отменил, тк просвета не вижу. Занимаю выжидательную позицию, будем смотреть
9) Неисполненный $ZGNX . Рассчитывал на отскок после роста, на данный момент ждать нечего, можно закрывать позицию.', '2022-01-26 20:53:56.539974', NULL, 1187, 'https://t.me/c/1708553007/1187');
