INSERT INTO public."Predicts_comments" (id, prediction_id, comment, created_date, updated_date, message_id, message_url) VALUES (103, 260, 'У вас накопилось уже много вопросов насчёт данных прогнозов, постараюсь на них ответить в одном посте:
