INSERT INTO public."Predicts_comments" (id, prediction_id, comment, created_date, updated_date, message_id, message_url) VALUES (136, 323, 'Уважаемые пользователи, я не могу отвечать 24/7 всем в комментариях, при малейшем движении акции. Если появляется что-то важное, я пишу комментарии к прогнозам. С точки зрения приоритетности - я думаю вы заинтересованы в том, чтобы качество прогнозов оставалось на уровне, а не в моей психологической поддержке каждого беспокоящегося.', '2022-02-11 10:32:17.76563', NULL, 1476, 'https://t.me/c/1708553007/1476');
