INSERT INTO public."Predicts_comments" (id, prediction_id, comment, created_date, updated_date, message_id, message_url) VALUES (139, 295, 'Грустно это все… закрылись ниже 120, если спекулянты то фиксируем солидный убыток, в долгосрок можно оставить, что я и сделал. Компания хорошая, нащупает дно и пойдёт в новый цикл роста, 200-300-400$ для неё вполне реальные цели, но придётся ждать. Где будет дно? Хороший вопрос, зону с 100 до 85 можно покупать, у меня усреднение стоит в районе 92', '2022-02-11 21:33:31.243115', NULL, 1500, 'https://t.me/c/1708553007/1500');
INSERT INTO public."Predicts_comments" (id, prediction_id, comment, created_date, updated_date, message_id, message_url) VALUES (140, 321, 'Много информации, пока что в войну верится все больше и больше, так или иначе - мы видимо идем по красному сценарию, в лонг с плечами или фьючерсами я бы пока не запрыгивал, опять таки, лучше потерять часть прибыли, чем потерять деньги. Долгосрочные инвесторы конечно могут ждать и закупаться, учитывая дивиденды и планируемые байбеки от $GAZP и $ROSN (а скорее всего и многих других, после стабилизации ситуации для поддержки фондового рынка), цены шикарные, и чем ниже - тем лучше, в конце концов на дивиденды докупитесь и через 2 года увидите x2 по многим компаниям.
upd: локально буду смотреть, будет очень интересная и насыщенная неделя, вытряхнут и лонгистов и шортистов, вбросы как хороших так и плохих новостей, огромные заявки как на покупку так и на продажу, заявки-айсберги в стаканах и прочее. Будьте аккуратны, лучше "сидеть на заборе"
upd2: даже при позитиве и мирном разрешении ситуации негатива уже достаточно, чтобы с нашего рынка побежала вторая пачка нерезидентов, думаю в лучшем случае увидим двойное дно по "голубым фишкам" и индексам

Напоминаю, это лишь мое мнение, я никого не призываю к действию или бездействию этим комментарием', '2022-02-14 00:21:19.034317', NULL, 1502, 'https://t.me/c/1708553007/1502');
INSERT INTO public."Predicts_comments" (id, prediction_id, comment, created_date, updated_date, message_id, message_url) VALUES (141, 347, 'Если к концу ОС не будет слива рынка то можно в целом закрывать или переносить на завтра, но переставьте стоп на 8.3.', '2022-02-15 19:00:09.885757', NULL, 1550, 'https://t.me/c/1708553007/1550');
INSERT INTO public."Predicts_comments" (id, prediction_id, comment, created_date, updated_date, message_id, message_url) VALUES (142, 341, 'По $F и $GPS: у прогнозов около 6-7% прибыли, если вы боитесь потерять деньги, не верите в прогноз или просто очень сильно переживаете - можете лесенкой фиксировать условные каждые +2%, либо переставлять стоп на своё усмотрение. В целом идут нормально, по $GPS был даунгрейд, поэтому его чуть слили до ОС, он подошел к середине безоткатного канала, + сильный уровень поддержки. Но если сработает стоп - лучше выходить, так как имеет потенциал сходить от стопа ещё на минус 57-58%', '2022-02-15 20:29:13.562625', NULL, 1551, 'https://t.me/c/1708553007/1551');
