INSERT INTO public."Predicts_comments" (id, prediction_id, comment, created_date, updated_date, message_id, message_url) VALUES (148, 375, 'Когда прогноз исполнится (если исполнится), можно не сразу фиксировать, а посмотреть на реакцию от 300, возможно полетим ещё глубже, но перед выходными я бы наверное частично зафиксировался. 
