INSERT INTO public."Predicts_comments" (id, prediction_id, comment, created_date, updated_date, message_id, message_url) VALUES (152, 380, 'Насчет шорта по рос акциям: скоро $IMOEX столкнется с поддержкой в виде 200-недельной EMA, примерно через -1% с текущих, так что частично имеет смысл фиксировать позиции, если вы открывали их раньше (не обязательно по прогнозам), и каждые 2% по висящим прогнозам по $SBER и $GAZP', '2022-02-21 13:32:14.860381', NULL, 1686, 'https://t.me/c/1708553007/1686');
INSERT INTO public."Predicts_comments" (id, prediction_id, comment, created_date, updated_date, message_id, message_url) VALUES (153, 385, 'Эта кипа прогнозов на РФ рынок сделана исходя из уверенности, что Путин в 21.00 признает независимость. Прогнозы даны на компании с гос. поддержкой\государственные\связанные с добычей ресурсов.
