INSERT INTO public."Predicts_comments" (id, prediction_id, comment, created_date, updated_date, message_id, message_url) VALUES (155, 378, 'Обидно что на панике выбило стопы по PLZL и POLY, я продолжаю их держать, после паники была из переоценка рынком, это один из немногих активов, который сегодня показывает зелёный цвет', '2022-02-22 08:12:23.375284', NULL, 1875, 'https://t.me/c/1708553007/1875');
