INSERT INTO public."Predicts_comments" (id, prediction_id, comment, created_date, updated_date, message_id, message_url) VALUES (154, 413, 'Мысли и пояснения по всем моим прогнозам:
1) Главная задача множества прогнозов была - контроль ситуации. Мог бы дать сразу шорт на -10-15%, но вдруг немного не дошло бы и пошел отскок (как произошло в конце)? Лучше по 3-5%, Но быть уверенным в исходе

2) Под конец был всплеск и резкий рост РФ рынка. Думаю, это можно назвать шортсквизом. Слишком перепроданный рынок, который начали откупать из-за чего и шорт у некоторых закрывался

3) После такого и уже опубликованных заявлений, сомневаюсь в росте. Думаю, завтра будет тоже грустный красный день. Прогнозы в силе, даже если вылетят по стопам', '2022-02-21 19:55:51.497163', NULL, 1844, 'https://t.me/c/1708553007/1844');
INSERT INTO public."Predicts_comments" (id, prediction_id, comment, created_date, updated_date, message_id, message_url) VALUES (157, 433, 'Золотодобытчиков должны переоценить, у рос золотодобытчиков прибыль в $, что при росто курса так же будет играть нам на руку. Золото частично отыграло риски геополитики, но все забывают о коррекции на Америке, золото не защита от инфляции, а защита от рисков', '2022-02-22 12:15:25.538707', NULL, 1895, 'https://t.me/c/1708553007/1895');
INSERT INTO public."Predicts_comments" (id, prediction_id, comment, created_date, updated_date, message_id, message_url) VALUES (160, 460, 'Друзья, пишу комментарии по двум действующим прогнозам. Cvx продолжит свой рост в ближайшие дни. #Gold почти дошел до цели и по прежнему вижу потенциал по данной акции. Рекомендую перед закрытием закрывать сделки и перезаходить завтра, у кого доли небольшие, можно и оставить. Я буду закрывать и завтра перезаходить. Рекомендация ✅', '2022-03-01 20:15:05.767223', NULL, 2034, 'https://t.me/c/1708553007/2034');
INSERT INTO public."Predicts_comments" (id, prediction_id, comment, created_date, updated_date, message_id, message_url) VALUES (161, 468, 'Я знаю риски Тайваня, но $LI очень сильная компания, даже по графику выглядит в несколько раз лучше чем $BABA например.
