INSERT INTO public."Predicts_comments" (id, prediction_id, comment, created_date, updated_date, message_id, message_url) VALUES (159, 440, 'Просили комментарии по рынку: сейчас все идёт в бездну по понятным причинам, торги временно остановлены, открываться будем на планке с гэпами. Проблема в том, что у большинства рос акций на 5-10% ниже уровни поддержки, и если мы их пробьем, сложимся ещё в 2 раза. (Это лично мое мнение), +- адекватно себя сейчас чувствуют только золотодобытчики, им не даёт сильно упасть цена на золото.', '2022-02-24 05:00:59.739479', NULL, 1973, 'https://t.me/c/1708553007/1973');
